import React from "react";
import { Link } from "react-router-dom";

function Contact(){
    return(
        <>
            <h1>Contact Page</h1>
            <p>Here are our some bussinesses</p>
            <Link to="company">Company</Link>
        </>
    )
}


export default Contact;
